import "./css/Duxford.css"
import L4 from "./img/DSC_6158.jpg"


function Duxford() {
  return (
    <div className="duxford">

      <h2>Welcome to This Majestic Flying Day</h2>

      <p>On June 6, 1944, the Allies landed on the beaches of Normandy during a short period of favorable
        weather, changing the process of World War II. 77 years later, the Imperial War Museum Duxford
        commemorated the soldiers, pilots and sailors who joined the landing operation against
        all emeries with a "D-Day anniversary air show" which is the same as the world have been fighting for its own D-Day since the start of the COVID-19 pandemic.</p>
      <p>On this site, you will find three highlights of the day, a number of magnificent
        images of the ‘heavy iron’ warbirds, information about participating in the flying day,
        information about the Imperial War Museum, and profiles of the photographer.</p>

      <div className="duxford-photo-div">
        <img className="duxford-photo" src={L4}
          alt="Another L-4 is waiting for the take-off" />
      </div>

    </div>

  );
}

export default Duxford;
